import React from "react";
import "./Header.css";

class Header extends React.Component{
    render(){
        return (
           <nav className="Nav">
             <div className="Nav-menus">
                 <a className="Nav-logo" href="/">
                 </a>
			<div style={{width:200}}>
			</div>
                 <a className="Nav-gallery">
                 </a>

                 <a className="Nav-favorite">
                 </a>

                 <a className="Nav-profile">
                 </a>
             </div>
           </nav>
       );
    }   
}

export default Header;
